import './style/IMessage.css';
import Header from './Header';
import Sidebar from './Sidebar';
import Chat from './Chat';

function IMessage() {
    return (

        <div className='imessage'>
            {/* Header */}
            <div className='header'>

            </div>
            <Header/>

            {/* sidebar */}
            <div>
                <Sidebar/>


                {/* chat */}
                <Chat/>
            </div>

        </div>
    )
}

export default IMessage
